// @use "~bootstrap/scss/bootstrap" as *;

@use "./reset" as *;

$--fs-xs: 0.75rem;
$--fs-s: 0.875rem;
$--fs-base: 1rem;
$--fs-l: 1.125rem;
$--fs-xl: 1.25rem;
$--fs-2xl: 1.5rem;
$--fs-3xl: 1.875rem;
$--fs-4xl: 2.25rem;
$--fs-5xl: 3rem;
$--fw-normal: 400;
$--fw-medium: 500;
$--fw-bold: 700;
$--fw-heavy: 800;
$--lh-tight: 1.25;
$--lh-base: 1.5;

$content-size: clamp(0.875rem, 0.7045rem + 0.7273vw, 1.2rem);

body {
  font-family: "Inter";
  overflow-x: hidden;
}

.se {
  height: 640px;
  border-bottom: 1px solid black;
}

.intro {
  display: flex;
  flex-direction: column;

  position: relative;
  &.first {
    background-color: #086788;
  }

  &__img-white {
    margin-top: 189px;
  }

  &__img-bold {
    margin-top: 100px;
  }

  &__group {
    margin-top: 60px;
  }

  &__signin {
    display: block;
    width: min(300px, 100%);
    margin: 0 auto;
    border: none;
    border-radius: 15px;
    padding: 10px 14px;
    color: #010c10;
    font-size: $--fs-base;
    line-height: 19px;
    font-weight: 400;

    text-align: start;

    position: relative;
    img {
      position: absolute;
      right: 10px;
    }

    &.user {
      background: #f0c808;
    }

    &.admin {
      background: #ececec;
    }

    & + & {
      margin-top: 10px;
    }
  }

  &__text {
    font-size: 18px;
    line-height: 22px;
    /* identical to box height */

    /* Чёрный */

    color: #010c10;

    margin-top: 20px;
  }

  &__subtitle {
    font-size: 10px;
    line-height: 12px;
    text-align: center;

    /* Чёрный */
    padding-left: 3px;

    color: #010c10;
  }

  .input {
    &__group {
      text-align: center;
      margin-top: 20px;
    }
    &__tel {
      border: none;
      width: min(300px, 100%);
      background: #ececec;
      border-radius: 20px;

      padding: 15px;

      font-size: 14px;
      line-height: 17px;

      color: #868686;
    }

    &__text {
      font-size: 13px;
      line-height: 15px;
      /* identical to box height */

      /* Чёрный */

      color: #010c10;
    }

    &__socials {
      img + img {
        margin-left: 1rem;
      }
    }
  }

  .bottom {
    width: 100%;
    position: absolute;
    bottom: 40px;
    text-align: center;

    &__link {
      span {
        color: #278808;
      }
    }
  }
}

.btn-green {
  width: 300px;
  background: #278808;
  border-radius: 20px;
  font-size: 16px;
  line-height: 19px;
  text-align: center;

  /* Белый */

  color: #ffffff;

  padding-block: 15px;
  border: none;
}

.btn-gray {
  width: 300px;
  background: #ececec;
  border-radius: 20px;
  font-size: 16px;
  line-height: 19px;
  text-align: center;

  font-weight: 500;

  /* Белый */

  color: #111;

  padding-block: 15px;
  border: none;
}

.pincode-container {
  display: flex;
  justify-content: center;
}

.pincode-input {
  width: 50px;
  height: 50px;
  text-align: center;
  font-size: 24px;

  margin: 0 5px;
  border-radius: 5px;
  outline: none;
  appearance: textfield;

  background-color: #ececec;
  /* Серый */

  border: 1px solid #868686;
  border-radius: 15px;

  font-weight: 400;
  font-size: 18px;
  line-height: 22px;
  /* identical to box height */

  /* Чёрный */

  color: #010c10;
}

.pincode-input:focus {
  border: 1px solid #086788;
}

.pincode-text {
  width: 300px;

  font-weight: 400;
  font-size: 12px;
  line-height: 15px;
  text-align: center;

  /* Чёрный */

  color: #010c10;

  span {
    text-decoration: underline;
  }
}

.address {
  .met {
    position: absolute;
    top: 3px;
    left: 12px;
    transform: scale(1.15);
  }

  &__text {
    margin-left: 2.5rem;
  }

  p {
    font-size: 10px;
  }

  &__desc {
    font-size: 14px;
  }
}

.home {
  margin-inline: 10px;
  margin-top: 20px;
}

.tab {
  overflow: hidden;
  display: flex;
  border: 1px solid #ececec;
  border-radius: 22px;
}

/* Style the buttons that are used to open the tab content */
.tab button {
  background-color: inherit;
  border: none;
  flex: 0.5;
  padding: 10px 2px;
  transition: 0.3s;
  border-radius: 22px;
